import { useSelector } from 'react-redux'
import Col from 'react-bootstrap/Col'
import Row from 'react-bootstrap/Row'
import CardTodo from '../CardTodo'

const ListTodo = () => {

  const todos = useSelector( (state) => state.todo )

  return (
    <Row>
      {
       todos && todos.map(
          (task) => (
            <Col key={task.id} >
              <CardTodo />
            </Col>
          ) 
        )
      }
    </Row>
  )  
}

export default ListTodo
